const ops = {
    addr: (before, instruction) => before.map((r, i) =>  (i === instruction[3]) ? before[instruction[1]] + before[instruction[2]] : r),
    addi: (before, instruction) => before.map((r, i) =>  (i === instruction[3]) ? before[instruction[1]] + instruction[2] : r),
    mulr: (before, instruction) => before.map((r, i) =>  (i === instruction[3]) ? before[instruction[1]] * before[instruction[2]] : r),
    muli: (before, instruction) => before.map((r, i) =>  (i === instruction[3]) ? before[instruction[1]] * instruction[2] : r),
    banr: (before, instruction) => before.map((r, i) =>  (i === instruction[3]) ? before[instruction[1]] & before[instruction[2]] : r),
    bani: (before, instruction) => before.map((r, i) =>  (i === instruction[3]) ? before[instruction[1]] & instruction[2] : r),
    borr: (before, instruction) => before.map((r, i) =>  (i === instruction[3]) ? before[instruction[1]] | before[instruction[2]] : r),
    bori: (before, instruction) => before.map((r, i) =>  (i === instruction[3]) ? before[instruction[1]] | instruction[2] : r),
    setr: (before, instruction) => before.map((r, i) =>  (i === instruction[3]) ? before[instruction[1]] : r),
    seti: (before, instruction) => before.map((r, i) =>  (i === instruction[3]) ? instruction[1] : r),
    gtir: (before, instruction) => before.map((r, i) =>  (i === instruction[3]) ? (instruction[1] > before[instruction[2]]) ? 1 : 0 : r),
    gtri: (before, instruction) => before.map((r, i) =>  (i === instruction[3]) ? (before[instruction[1]] > instruction[2]) ? 1 : 0 : r),
    gtrr: (before, instruction) => before.map((r, i) =>  (i === instruction[3]) ? (before[instruction[1]] > before[instruction[2]]) ? 1 : 0 : r),
    eqir: (before, instruction) => before.map((r, i) =>  (i === instruction[3]) ? (instruction[1] === before[instruction[2]]) ? 1 : 0 : r),
    eqri: (before, instruction) => before.map((r, i) =>  (i === instruction[3]) ? (before[instruction[1]] === instruction[2]) ? 1 : 0 : r),
    eqrr: (before, instruction) => before.map((r, i) =>  (i === instruction[3]) ? (before[instruction[1]] === before[instruction[2]]) ? 1 : 0 : r),
}

const getPosibleOperations = (before, instruction, after) => {
    let posibleOperations = []
    for (var op in ops)
        if (_.isEqual(ops[op](before, instruction), after)) posibleOperations.push(op)
    return posibleOperations
}

const processInput = (rawInput) => {
    let operations = []
    let input = rawInput.filter(i => i !== '')
    for (let i = 0; i < input.length; i+=3) {
        operations.push({
            before: input[i].split('[')[1].split(']')[0].split(',').map(n => parseInt(n)),
            instruction: input[i+1].split(' ').map(n => parseInt(n)),
            after: input[i+2].split('[')[1].split(']')[0].split(',').map(n => parseInt(n)),
        })
    }
    return operations
}

const processSamples = (samples) => {
    let possibleOpCodes = Array(16).fill().map(o => Object.keys(ops))
    let moreThanThree = 0
    for (let i = 0; i < samples.length; i++) {
        let possibleOperations = getPosibleOperations(samples[i].before, samples[i].instruction, samples[i].after)
        if (possibleOperations.length >= 3)
            moreThanThree++
            possibleOpCodes[samples[i].instruction[0]] = _.intersection(possibleOpCodes[samples[i].instruction[0]], possibleOperations)
    }
    return {
        moreThanThree,
        possibleOpCodes
    }
} 

console.log('16-1 solution: ' + processSamples(processInput(input)).moreThanThree)

module.exports = {
    input,
    ops,
    processInput,
    processSamples,
}